function NavbarTemp({ loggedIn, userRole }) {
  if (!loggedIn) {
    return <Navbar />;
  }

  switch (userRole) {
    case 'Customer':
      return <CustomerNavar />;
    case 'Employee':
      return <EmployeeNavar />;
    case 'Manager':
      return <ManagerNavBar />;
    default:
      return <Navbar />;
  }
}

export default NavbarTemp;
